import mainBox from "./main";
import getPageTitle from '@/utils/getPageName';
import { queryManufacturers } from "@/api/project/iot/IOT/em";
export default {
  name: "myProject",
  components: {
    mainBox: mainBox
  },
  // , EM, GA, DB, IA, EMTabs, GATabs
  data: function data() {
    return {
      pages: 'main',
      code: undefined,
      //一级页面项目编码s
      row: undefined,
      // 二级页面选择的行
      title: getPageTitle(this.$route.name),
      manufacturersList: null
    };
  },
  created: function created() {
    this.$store.dispatch('iotDict/getDicData', ['iot_project_type']); // 'iot_nameplate_state', 'iot_operator', 'iot_networking_way', 'iot_reporting_period', 'iot_state', 'iot_state_gateway', 'iot_state_device', 'iot_attribute_type', 'iot_attribute_company', 'iot_data_type', 'iot_read_type', 'iot_norm_company', 'iot_is_standard'

    this.getTeam();
  },
  methods: {
    setPage: function setPage(pages) {
      this.pages = pages;
    },
    setCode: function setCode(code) {
      this.code = code;
    },
    setRow: function setRow(row) {
      this.row = row;
    },
    getTeam: function getTeam() {
      var _this = this;

      queryManufacturers().then(function (res) {
        _this.manufacturersList = res.data.list;
      });
    }
  }
};
